let timeCount=0;const sleepResponse=function(e,s){setTimeout((function(){timeCount+=1e4,timeCount>9e5?self.postMessage("cancel"):verifyUpiResponseReceived(e,s)}),1e4)};function verifyUpiResponseReceived(e,s){const n={pgRefNum:e};fetch("/pgui/jsp/verifyUpiResponse",{method:"POST",body:JSON.stringify(n),headers:{"Content-Type":"application/json",Accept:"application/json"}}).then((e=>e.json())).then((n=>{if(null!=n){let t=n.transactionStatus;"Sent to Bank"==t||"Pending"==t?sleepResponse(e,s):self.postMessage(n)}else sleepResponse(e,s)})).catch((e=>{}))}self.onmessage=function(e){if(void 0!==e.data){var s=e.data;verifyUpiResponseReceived(s.value,s.requestType)}};